        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          email: formData.email,
          phone: formData.phone,
          privacy_consent: formData.privacyConsent
        }),
      });

      if (response.ok) {
        const data = await response.json();
        setCouponCode(data.coupon_code);
